def prod_signs(arr):
    if not arr:
        return None

    signs = {1, -1, 0}
    prod = 0
    for num in arr:
        for sign in signs:
            if sign == 0:
                continue
            prod += num * sign
        signs = signs - {0}

    return prod

def prod_signs(arr):
    if not arr:
        return None
    result = 0
    for x in arr:
        sign = 1 if x > 0 else -1
        magnitude = abs(x)
        result += sign * magnitude
    return result

